import React, { createContext, useContext, useState, useEffect } from 'react';
import supabase from './supabaseClient';

// Create auth context
const AuthContext = createContext();

// Custom hook to use the auth context
export const useAuth = () => {
  return useContext(AuthContext);
};

export const AuthProvider = ({ children }) => {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [isEmailVerified, setIsEmailVerified] = useState(false);

  useEffect(() => {
    // Check for existing session
    const checkUser = async () => {
      try {
        // Check Supabase session
        const { data: { session }, error } = await supabase.auth.getSession();

        if (error) {
          throw error;
        }

        if (session) {
          // Check email verification status
          const isVerified = session.user.email_confirmed_at !== null;
          setIsEmailVerified(isVerified);

          // Get user data from users table
          const { data: userData, error: userError } = await supabase
            .from('users')
            .select('*')
            .eq('email', session.user.email)
            .single();

          if (userError) {
            throw userError;
          }

          setUser({
            id: userData.user_id,
            name: userData.name,
            email: userData.email,
            isPremium: userData.is_premium,
            avatar: userData.avatar_url,
            emailVerified: isVerified
          });

          setIsAuthenticated(true);

          // Store in localStorage
          localStorage.setItem('healthsync_auth', 'true');
          localStorage.setItem('healthsync_user', JSON.stringify({
            id: userData.user_id,
            name: userData.name,
            email: userData.email,
            isPremium: userData.is_premium,
            avatar: userData.avatar_url,
            emailVerified: isVerified
          }));
        } else {
          // Check localStorage as fallback (useful for demo mode)
          const storedAuth = localStorage.getItem('healthsync_auth');
          const storedUser = localStorage.getItem('healthsync_user');

          if (storedAuth === 'true' && storedUser) {
            const parsedUser = JSON.parse(storedUser);
            setUser(parsedUser);
            setIsAuthenticated(true);
            setIsEmailVerified(parsedUser.emailVerified || false);
          } else {
            setUser(null);
            setIsAuthenticated(false);
            setIsEmailVerified(false);
          }
        }
      } catch (error) {
        console.error('Auth error:', error.message);
        // Clear any potentially corrupt local data
        localStorage.removeItem('healthsync_auth');
        localStorage.removeItem('healthsync_user');
        setUser(null);
        setIsAuthenticated(false);
        setIsEmailVerified(false);
      } finally {
        setLoading(false);
      }
    };

    // Set up auth state listener
    const { data: authListener } = supabase.auth.onAuthStateChange(
      async (event, session) => {
        if (event === 'SIGNED_IN' && session) {
          // Check email verification status
          const isVerified = session.user.email_confirmed_at !== null;
          setIsEmailVerified(isVerified);

          // Get user data from users table
          const { data: userData, error: userError } = await supabase
            .from('users')
            .select('*')
            .eq('email', session.user.email)
            .single();

          if (!userError && userData) {
            setUser({
              id: userData.user_id,
              name: userData.name,
              email: userData.email,
              isPremium: userData.is_premium,
              avatar: userData.avatar_url,
              emailVerified: isVerified
            });

            setIsAuthenticated(true);

            // Store in localStorage
            localStorage.setItem('healthsync_auth', 'true');
            localStorage.setItem('healthsync_user', JSON.stringify({
              id: userData.user_id,
              name: userData.name,
              email: userData.email,
              isPremium: userData.is_premium,
              avatar: userData.avatar_url,
              emailVerified: isVerified
            }));
          }
        }

        if (event === 'SIGNED_OUT') {
          setUser(null);
          setIsAuthenticated(false);
          setIsEmailVerified(false);
          localStorage.removeItem('healthsync_auth');
          localStorage.removeItem('healthsync_user');
        }
      }
    );

    checkUser();

    // Clean up subscription
    return () => {
      if (authListener && authListener.subscription) {
        authListener.subscription.unsubscribe();
      }
    };
  }, []);

  // Request verification email 
  const sendVerificationEmail = async (email) => {
    try {
      const { error } = await supabase.auth.resend({
        type: 'signup',
        email: email,
      });

      if (error) throw error;

      return { success: true, message: 'Verification email sent!' };
    } catch (error) {
      return { success: false, error: error.message };
    }
  };

  // Sign out function
  const signOut = async () => {
    try {
      await supabase.auth.signOut();
      // Clear local storage
      localStorage.removeItem('healthsync_auth');
      localStorage.removeItem('healthsync_user');
      setUser(null);
      setIsAuthenticated(false);
      setIsEmailVerified(false);
      return { success: true };
    } catch (error) {
      return { success: false, error: error.message };
    }
  };

  // Value to be provided to consuming components
  const value = {
    user,
    isAuthenticated,
    isEmailVerified,
    loading,
    signOut,
    sendVerificationEmail
  };

  return (
    <AuthContext.Provider value={value}>
      {!loading && children}
    </AuthContext.Provider>
  );
};

export default AuthProvider;
